import styles from "./Works.module.scss";
import agencyProjectIcon from "../../images/agency.jpg";

type worksDetail = {
	imgSrc: string;
	text: string;
};

const worksDetails: worksDetail[] = [
	{
		imgSrc: agencyProjectIcon,
		text: "Agency",
	},
];

const Works = () => {
	return (
		<main className="relative flex justify-around items-center flex-wrap w-full h-[82vh] px-28  text-lg text-gray-600 ">
			{worksDetails.map((detail, i) => (
				<div
					key={i}
					className="flex flex-col items-center gap-4"
				>
					<img
						src={detail.imgSrc}
						alt=""
					/>
					<span>{detail.text}</span>
				</div>
			))}
		</main>
	);
};

export default Works;
